import React from "react";
import Header from "components/Header/Header.js";
// sections for this page
import HeaderLinks from "components/Header/HeaderLinks.js";


  const headr = (props) => {
    const { ...rest } = props;
    return (

    <Header
    brand="eRent"
    rightLinks={<HeaderLinks />}
    fixed
    color="transparent"
    changeColorOnScroll={{
      height: 400,
      color: "white",
    }}
    {...rest}
  />

    );

}
export default headr;
